import 'antd/dist/antd.css'
import { Col, Row } from 'antd'

function App() {
  return (
    <div className="App">
      <div className="site-card-wrapper">
        <Row gutter={16}>
          <Col span={8}>
            123
          </Col>
          <Col span={8}>
            456
          </Col>
          <Col span={8}>
            789
          </Col>
        </Row>
      </div>
    </div>
  );
}

export default App;
